import React from "react";
import Header from "./Header";
export const BeerList = ({ image_url, name, tagline, contributed_by }) => {
  return (
    <div>
      <Header></Header>
      <img width="50px" src={image_url} alt={name} />
      <ul>
        <li>
          <h2>{name}</h2>
        </li>
        <li>{tagline}</li>
        <li>contributed by: {contributed_by}</li>
      </ul>
    </div>
  );
};
